import React from 'react';

const NavBar = (props) =>{
    return(
        <div className='w-screen h-screen-15% bg-prussian-blue flex justify-evenly items-center'>
            <div className='w-2/5 h-2/3 flex items-center justify-center select-none'>
                <img src = "./images/raccon.jpg">ok</img>
            </div>
            <div className='w-2/5 h-2/3 bg-athens-black flex items-center justify-center select-none'>
                <h1 className='font-general-font text-5xl text-white'>Winter Internship</h1>
            </div>
            <div className='w-2/5 h-2/3 bg-school-bus-yellow'></div>
        </div>
    );
}

export default NavBar;
